import { FaClinicMedical,
         FaCar,
         FaTruck,
         FaHamburger,
         FaHome,
         FaGift,
         FaChild,
         FaTshirt,
         FaNewspaper } from "react-icons/fa";

import { CategoryStyle } from './CategoryStyle'
import './category.css'

function Categories(props: any) { 
console.log('props recieved', props)
const {text} = props
  const getexpense =(e: React.MouseEvent)=> {
    alert(`WHat the hell ${e}`)
  }
  return (
        <CategoryStyle onClick = {(e) =>getexpense(e)}>
          {
            text === 'First Aid' ? <FaClinicMedical/> :
            text === 'Automobile' ? <FaCar /> :
            <FaChild/>
          }

        <span className='categoryName'>  { text } </span>
        </CategoryStyle>
  )
}

export default Categories
